class Solution {
    func missingInteger(_ nums: [Int]) -> Int {
        var maxLength = 0
        var currentLength = 1
        var sum = nums[0]
        var maxSum = nums[0]

        // Identify the longest sequential prefix
        for i in 1..<nums.count {
            if nums[i] == nums[i - 1] + 1 {
                currentLength += 1
                sum += nums[i]
            } else {
                if currentLength > maxLength {
                    maxLength = currentLength
                    maxSum = sum
                }
                currentLength = 1
                sum = nums[i]
            }
        }

        // Check last sequence if it's the longest
        if currentLength > maxLength {
            maxSum = sum
        }

        // Find the smallest missing integer
        var missingInteger = maxSum + 1
        while nums.contains(missingInteger) {
            missingInteger += 1
        }

        return missingInteger
    }
}
